(2192,	25,	1,	'Savage Salvation (2022)',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ Savage Salvation ซาเวจ ซาเวชั่น</strong></p>\r\n\r\n<p>เชอร์ริฟ เชิร์ช (โรเบิร์ต เดอ นีโร) และนักสืบเซปเปลินพยายามรักษาความสงบในเมืองที่ขรุขระ ซึ่งผู้อยู่อาศัยสนใจเพียงสองอย่างคือโบสถ์หรือออกซีโคโดน เชลบี จอห์น (แจ็ค ฮัสตัน)<br />\r\nและรูบี้ เรดที่เพิ่งหมั้นหมายกันใหม่ต้องการเริ่มต้นใหม่ พวกเขาตัดสินใจที่จะมีครอบครัวด้วยกันและทำความสะอาดโดยได้รับการสนับสนุนจากปีเตอร์ น้องเขยของรูบี้ (จอห์น มัลโควิช) อย่างไรก็ตาม Shelby พบว่า Ruby อันเป็นที่รักของเขาเสียชีวิตอยู่ที่ระเบียงของพวกเขาก่อนที่เธอจะทำตามความปรารถนาสุดท้ายของเธอ นั่นคือการรับบัพติสมาในแม่น้ำและล้างบาปในอดีตของเธอ ด้วยความเดือดดาลที่เร่าร้อน เชลบีเริ่มลงมือฆ่าล้างแค้นเพื่อแก้ไขความผิดทั้งหมดที่ทำกับรูบี้ตามทุกการเชื่อมโยงในห่วงโซ่การค้ายาเสพติด เชลบีมีอาวุธครบมือนอกจากอะดรีนาลีนและปืนยิงตะปู เลือกพ่อค้าและขี้ยาทีละคนจนกระทั่งเขาขึ้นสู่จุดสูงสุด นายอำเภอ เชิร์ชและนักสืบเซปเปลินต้องแข่งกับเวลาเพื่อยุติความยุติธรรมของศาลเตี้ยของเชลบีก่อนที่การต่อสู้กับเจ้าพ่ออาชญากรโคโยตี้ (ควาโว) จะเปลี่ยนทั้งเมืองให้กลายเป็นการนองเลือด</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/23122022180821-2565-12-23_18h07_18.jpg',	'67mj224y6hw',	'',	'2023-03-14',	0,	2,	0,	'',	'SUB',	25,	2022,	'5.4',	'',	'',	'ดูหนังฟรี Savage Salvation (2022)',	'ดูหนังฟรี Savage Salvation (2022)',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, ดูหนังออนไลน์, Savage Salvation (2022)',	'https://master3.baraq.xyz/PlayList/63a55a91b1e252KL/master.m3u8',	2994),
(2193,	25,	1,	'TENET (2020) เทเน็ท',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<h2><a href=\"https://movie.trueid.net/tag/Tenet%20%E0%B9%80%E0%B8%97%E0%B9%80%E0%B8%99%E0%B9%87%E0%B8%97\" rel=\"noopener\" target=\"_blank\"><strong>เรื่องย่อ เทเน็ท (Tenet)</strong></a></h2>\r\n\r\n<p><strong><img alt=\"เรื่องย่อ เทเน็ท (Tenet)\" src=\"https://cms.dmpcdn.com/dara/2020/09/16/e8957310-f7d3-11ea-9a04-85e12b3366ed_original.jpg\" /></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>อาวุธเป็นเพียงหนึ่งคำ เทเน็ท และการต่อสู้เพื่อเอาตัวรอดจากทั่วโลก ตัวละครได้เดินทางผ่านรุ่งอรุณแห่งการโจรกรรมข้ามประเทศ ในภารกิจที่จะเปิดโปงบางสิ่งที่อยู่เหนือกาลเวลาจริง&nbsp; ไม่ใช่เป็นการเดินทางข้ามเวลา แต่เป็นการย้อนกลับ</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"เรื่องย่อ เทเน็ท (Tenet)\" src=\"https://cms.dmpcdn.com/dara/2020/09/16/e8917b70-f7d3-11ea-9a04-85e12b3366ed_original.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"เรื่องย่อ เทเน็ท (Tenet)\" src=\"https://cms.dmpcdn.com/dara/2020/09/16/e8302190-f7d3-11ea-83eb-c5d532ad3b51_original.jpg\" /></p>\r\n\r\n<h3><strong>นักแสดงนำ</strong></h3>\r\n\r\n<p>จอห์น เดวิด วอชิงตัน รับบท สายลับซีไอเอ</p>\r\n\r\n<p>โรเบิร์ต แพททินสัน รับบท&nbsp; นีล</p>\r\n\r\n<p>เอลิซาเบธ เดบิคกี้ รับบท แคท</p>\r\n\r\n<p>ดิมเพิล คาปาเดีย รับบท ปรียา</p>\r\n\r\n<p>อารอน เทย์เลอร์-จอห์นสัน รับบท ไอเวส</p>\r\n\r\n<p>ไมเคิล เคน รับบท เซอร์ ไมเคิล ครอสบี</p>\r\n\r\n<p>เคนเน็ธ บรานาห์ รับบท อังเดร เซเทอร์</p>\r\n\r\n<p><img alt=\"เรื่องย่อ เทเน็ท (Tenet)\" src=\"https://cms.dmpcdn.com/dara/2020/09/16/e82dfeb0-f7d3-11ea-83eb-c5d532ad3b51_original.jpeg\" /></p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/21122022081829-2565-12-21_08h18_23.jpg',	'LdOM0x0XDMo',	'',	'2023-03-14',	0,	4,	0,	'',	'HD',	25,	2020,	'8.2',	'',	'',	'ดูหนังฟรี TENET (2020) เทเน็ท',	'ดูหนังฟรี TENET (2020) เทเน็ท',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, TENET (2020), เทเน็ท',	'https://streamhls.com/view/4bfa8062-f014-588d-82e6-01e3c50f11ce.m3u8',	2993),
(2191,	25,	1,	'Violent Night (2022) คืนเดือด',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>รีวิวหนัง&nbsp;Violent Night (2022) คืนเดือด</p>\r\n\r\n<p>ย่างเข้าสู่เดือนธันวาคม ท่วงทำนองเพลงประกอบเทศกาลก็เริ่มดังกังวานมากยิ่งขึ้นเรื่อย ๆ และมันก็ประจวบเหมาะกับการมาของหนังที่เข้ากับช่วงบรรยากาศเช่นนี้ เพียงแต่ว่าปีนี้เขาไม่ได้ด้วยมาดที่อบอุ่นเป็นที่รักของเด็ก ๆ เพียงอย่างเดียว เพราะว่าครั้งนี้เขามาเพื่อ..สู้กลับ กับหนังคริสต์มาสคอนเซ็ปต์น่าสนใจ &quot;Violent Night คืนเดือด&quot; ที่เป็นการผสมผสานทุกอรรถรสความบันเทิงของหนังฮอลลิวูดเข้าเป็นหนึ่งเดียวได้โดยแท้</p>\r\n\r\n<p><img alt=\"รีวิวหนัง Violent Night คืนเดือด\" src=\"https://cms.dmpcdn.com/dara/2022/10/28/5b132860-56cd-11ed-8b3c-598ca01694a2_webp_original.jpg\" /></p>\r\n\r\n<p>Violent Night คืนเดือด เป็นเรื่องราวของกลุ่มทหารรับจ้างที่ได้รับงานมา เพื่อโจมตีเป้าหมายเป็นตระกูลมหาเศรษฐีที่กำลังเฉลิมฉลองในช่วงเทศกาลแห่งครอบครัว งานนี้ถึงเวลาของ ซานต้าคลอส ที่จะต้องออกโรงบู๊ในการกอบกู้สถานการณ์ ที่จะช่วยพิทักษ์โลก ปกป้องครอบครัวนี้ และวันคริสต์มาส กลายเป็นมหกรรมการต่อสู้ที่แม้แต่เวทมนตร์แห่งวันคริสต์มาสยังมิอาจเทียบได้!</p>\r\n\r\n<p>แน่นอนว่าแค่เห็นชื่อผู้กำกับ &quot;ทอมมี่ เวอโกล่า&quot; ก็น่าจะการันตีได้ถึงความโหดความดิบอันมีสไตล์ของเขา แบบที่เขาเคยทำได้เอาไว้ในหนังแจ้งเกิด Dead Snow ทั้ง 2 ภาค มาคราวนี้ถือว่าได้รับโอกาสที่ยิ่งใหญ่ขึ้น ได้มาหยิบจับสร้างสตูดิโอใหญ่ดูบ้าง แน่นอนว่ามีอะไร ๆ ให้เขาได้เล่นแบบไม่ยั้งเพิ่มขึ้นมีเพียบ และไม่ปล่อยให้ลีลาการละเลงในบู๊ตามจังหวะของเขาผู้นี้ต้องเสียเปล่าไป และยังสามารถสอดแทรกประเด็นอื่น ๆ ตามใบสั่งเอาไว้ได้อย่างบันเทิงใจต่อคนดูจริง ๆ</p>\r\n\r\n<p><img alt=\"รีวิวหนัง Violent Night คืนเดือด\" src=\"https://cms.dmpcdn.com/dara/2022/10/28/5bd45580-56cd-11ed-8ac1-3fb784635b76_webp_original.jpg\" /></p>\r\n\r\n<p>หนังเรื่องนี้ได้คู่หูนักเขียน &quot;แพต เคซีย์&quot; กับ &quot;จอช มิลเลอร์&quot; แห่ง Sonic the Hedgehog ทั้ง 2 ภาคที่ผ่านมา มารับหน้าที่ปรุงแต่งเรื่องราวบู๊สุดอบอุ่นให้ คงจะต้องบอกว่าบทหนังก็ไม่ได้สมบูรณ์แบบอะไรเท่าไหร่ มาเป็นแพ็คสำเร็จของบทหนังแนวเทศกาลแบบเดิม ๆ แต่กลับใส่ลูกเล่นเอาไว้ได้แน่นเอียด เราอาจจะบัญญัติได้ว่าหนังเรื่องเป็นแนวแอคชั่นผสมตลก ซ้ำยังเป็นความเป็นหนังครอบครัว มีสไตล์ขี้เล่นเป็นเจ็บตัว แต่ก็ขึงขังผสมโรงเรื่องอาชญากรรม ว้ำยังปะปนความเป็นดราม่าเข้าไปได้อีก มีหลากหลายอารมณ์และแนวทางในหนังเรื่องนี้เรื่องเดียวมาก ๆ</p>\r\n\r\n<p>และเมื่อนำองค์ประกอบทุก ๆ อย่างรวมกันนั้น Violent Night คืนเดือด จึงได้รสชาติที่ออกมาได้บันเทิงโดยแท้ เพราะหนังสามารถแทรกเข้าไปถึงทุก ๆ อณูของประเด็นได้ดี แม้ว่าจะเป็นแตะประเด็นนั้น ๆ แค่ผิวเผินเท่านั้นก็ตาม ไม่ได้ขยี้ไปสุดทาง แต่ก็เป็นความผิวเผินที่ต่อเติมแขนขาให้กับหนังได้มีอรรถรสที่สมบูรณ์ยิ่งขึ้น คอนเซ็ปต์ของหนังถือว่าเจ๋ง เพราะเป็นการหยิบสไตล์หนังครอบครัวฟีลกู้ดเกี่ยวกับคริสต์มาสที่เรามักจะเห็นบ่อย ๆ มาโยงผูกเข้ากับการโจรกรรมแอคชั่นสุดระห่ำ พล็อตแค่นี้คอหนังเห็นก็ซื้อใจได้แล้ว</p>\r\n\r\n<p><img alt=\"รีวิวหนัง Violent Night คืนเดือด\" src=\"https://cms.dmpcdn.com/dara/2022/10/28/5afa7040-56cd-11ed-b675-414091399276_webp_original.jpg\" /></p>\r\n\r\n<p>ถึงลำดับการเล่าเรื่องของหนังเรื่องนี้อาจจะไม่ได้กลมกล่อมได้ถึงที่สุด หนังคงมีบางส่วนบางตอนที่ขาด ๆ เกิน ๆ ย้วยเกินไป หยาบเกินไป รวมทั้งติดอาการทีเล่นทีจริงไปเยอะสักหน่อย แต่ก็จัดได้ว่าหนังก็มอบทุกรสชาติให้กับผู้ชมได้เป็นอย่างดี และรู้ดีกว่าคนดูต้องการอะไร และสามารถเข้าใจกับตอบโจทย์นั้น ๆ ออกมาได้ดี เป็นหนังคริสต์มาสที่เต็มไปด้วยฉากสยดสยองและหวาดเสียว ที่เผลอ ๆ จะต้องร้องกรี๊ดตามออกมาด้วย</p>\r\n\r\n<p>&quot;เดวิด ฮาร์เบอร์&quot; ก็คือยืนหนึ่งและแบกหนังทั้งเรื่องเอาไว้ได้สบาย ๆ แบบคนเดียวเลย ทุกคนจะต้องหลงรักซานต้าในรูปแบบของเขาตามกัน เพราะนี่คือซานต้าที่เหมือนจะสามารถแตะต้องและเข้าถึงได้ดีกว่าเรื่องอื่น ๆ สามารถถ่ายทอดบทนี้ออกมาเป็นนักสู้ธรรมดา ที่มีเลือดมีเนื้อ ไม่ได้เก่งโอเวอร์เหนือธรรมชาติเกินไป สามารถปั้นคาแรกเตอร์ออกมาได้สมน้ำสมเนื้อ และเป็นคู่ต่อสู้ที่สร้างความบันเทิงได้โดดเด่นในหนังเรื่องนี้</p>\r\n\r\n<p><img alt=\"รีวิวหนัง Violent Night คืนเดือด\" src=\"https://cms.dmpcdn.com/moviearticle/2022/12/01/d9749850-70d7-11ed-8ea3-2d498a486458_webp_original.jpg\" /></p>\r\n\r\n<p>ขณะที่ทีมนักแสดงสมทบคนอื่น ๆ ก็ถือว่าทำได้ดีตามมาตรฐาน แม้ว่าพวกเขาจะไม่ได้โดดเด่นเท่ากับบทซานต้า แต่การมีทุกคนอยู่ในซีนร่วมด้วยกัน เป็นองค์ประกอบเสริมที่ดี ช่วยกันปล่อยมุกและส่งต่อกันอย่างไหลลื่น ไม่ว่าจะเป็น &quot;เบเวอรี่ ดีแองเจโล&quot;, &quot;จอห์น เลอกิซาโม&quot;, &quot;แคม จีกอนเดต์&quot;, &quot;อเล็กซิส ลาวเดอร์&quot; หรือ &quot;เอดี้ แพตเตอร์สัน&quot; พวกเขาเป็นตัวขโมยซีนที่เป็นสีสันให้กับหนังเรื่องนี้ได้ดีแท้</p>\r\n\r\n<p>ดังนั้นโดยภาพรวมแล้ว Violent Night คืนเดือด จึงกลายเป็นหนังที่เติมเต็มและมอบความบันเทิงได้ครบรสชาติให้กับผู้ชมโดยแท้ แม้ว่ามันจะเป็นแค่หนังสูตรสำเร็จที่เดาได้ง่าย ๆ และก็เป็นความบันเทิงที่เพลินและสนุกไปตลอดทั้งเรื่อง เป็นหนังที่หยิกแกมหยอกออกมาได้อย่างสร้างสรรค์ หยิบยืมหนังคริสต์มาสดัง ๆ มาใช้เป็นกลิ่นอายเรียกแขก บอกได้เลยว่าทั้งบู๊ ทั้งฮา ทั้งอบอุ่น มันอบอวลอยู่ในเรื่องนี้เรื่องเดียวได้อย่างน่าอัศจรรย์</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/23122022180938-Violent-Night-2022.jpg',	'a53e4HHnx_s',	'',	'2023-03-14',	0,	1,	0,	'',	'SUB',	25,	2022,	'6.1',	'',	'',	'ดูหนังฟรี Violent Night (2022) คืนเดือด',	'ดูหนังฟรี Violent Night (2022) คืนเดือด',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, ดูหนังออนไลน์, Violent Night (2022), คืนเดือด',	'https://master2.ataxbayle.xyz/PlayList/63a3d7e4c1133cC0/master.m3u8',	2995),
