(2188,	26,	1,	'The Amazing Maurice (2022)',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ&nbsp;The Amazing Maurice (2022) </strong></p>\r\n\r\n<p>ภาพยนต์การ์ตูนอนิเมชั่นแนวผจญภัยตลกคอมเมดี้ เรื่องราวของมอริซเป็นแมวขิงข้างถนนที่คิดอุบายทำเงินด้วยการผูกมิตรกับกลุ่มหนูพูดได้ เมื่อมอริซและเหล่าสัตว์ฟันแทะไปถึงเมืองบาดบลินซ์ พวกเขาได้พบกับหนอนหนังสือชื่อมาลิเซีย และในไม่ช้านักต้มตุ๋นตัวน้อยก็ตกท่อระบายน้ำ</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/23122022181530-ydhZeUjbzVEFclUpMhLfDZSavUY.jpg',	'4l7Z2VRcyK4',	'',	'2023-03-14',	0,	4,	0,	'',	'SUB',	31,	2022,	'5.2',	'',	'',	'ดูการ์ตูนฟรี The Amazing Maurice (2022)',	'ดูการ์ตูนฟรี The Amazing Maurice (2022)',	'เว็บเถื่อนการ์ตูนฟรี, ดูการ์ตูนฟรี, ดูหนังออนไลน์, The Amazing Maurice (2022)',	'https://master1.glacis.xyz/PlayList/63a5227217df5HB0/master.m3u8',	2998),
(2187,	25,	1,	'Moonfall (2022) วันวิบัติ จันทร์ถล่มโลก',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ&nbsp;Moonfall (2022) วันวิบัติ จันทร์ถล่มโลก</strong></p>\r\n\r\n<p><b>ประเภท</b>&nbsp;: ไซไฟ เขย่าขวัญ<br />\r\n<b>กำหนดฉาย</b>&nbsp;: 3 กุมภาพันธ์ 2022<br />\r\n<b>บริษัทจัดจำหน่าย</b>&nbsp;: มงคลเมเจอร์<br />\r\n<b>โปรดิวเซอร์</b>&nbsp;: ฮาราลด์ โคลเซอร์, โรแลนด์ เอมเมอร์ริช<br />\r\n<b>กำกับ</b>&nbsp;: โรแลนด์ เอมเมอร์ริช (Independence Day, 2012)<br />\r\n<b>เขียนบท</b>&nbsp;: สเปนเซอร์ โคเอน (Extinction) , ฮาราลด์ โคลเซอร์ (2012, 10,000 B.C)<br />\r\n<b>แสดงนำ</b>&nbsp;: ฮัลลี เบอร์รี (Monster Balls, X-Men) , แพทริก วิลสัน (Insidious, The Conjuring, Watchmen)<br />\r\n<br />\r\n<b>เรื่องย่อ</b><br />\r\nMoonfall ผลงานเรื่องล่าสุดของเจ้าพ่อหนังมหากาพย์ โรแลนด์ เอมเมอร์ริช (Independence Day, 2012) ด้วยทุนสร้างสูงถึง 140 ล้านเหรียญสหรัฐนำแสดงโดย ฮัลลี เบอร์รี, แพททริก วิลสัน, โดนัลด์ ซูเธอร์แลนด์, ไมเคิล พีน่า, ชาร์ลี พลัมเมอร์ และ จอห์น แบรดลีย์<br />\r\nภาพยนตร์ไซไฟ ที่เป็นลูกผสมระหว่าง Independence Day และ2012 เรื่องราวของทีมมนุษย์อวกาศที่ถูกส่งไปกู้วิกฤติหลังจากที่ดวงจันทร์โดยดาวเคราะห์น้อยชน จนวิถีโคจรมุ่งตรงมายังโลก และทำลายล้างทุกชีวิต เมื่อเวลาของมนุษยชาติเริ่มนับถอยหลัง โจ ฟาวเลอร์ (ฮัลลี เบอร์รี) เจ้าหน้าที่ระดับสูงของ NASA และอดีตมนุษย์อวกาศ อาจเป็นกุญแจสำคัญในการอยู่รอดของมวลมนุษย์แต่ทว่ามีแค่เพียง ไบรอัน ฮาร์เปอร์ (แพทริก วิลสัน) มนุษย์อวกาศที่เคยร่วมงานกับเธอ และ เค.ซี. เฮาส์แมน (จอห์น แบรดลีย์) นักทฤษฏีสมคบคิด เท่านั้นที่เชื่อมั่นในตัวเธอ เหล่าคนกล้าต้องเดินทางออกไปยังอวกาศในภารกิจชี้เป็นชี้ตาย เพื่อปกป้องคนพวกเขารักและทุกชีวิตบนโลก<br />\r\n<br />\r\n<b>เกร็ดภาพยนตร์</b><br />\r\n<br />\r\nโรแลนด์ เอมเมอริช เผยว่าตัวเขาเองเป็นคนที่หลงไหลในทฤษฏีสมคบคิดแม้ว่าตัวเขาจะไม่เชื่อมันก็ตาม เขาใช้มันเป็นไอเดีย เป็นจุดเริ่มต้นของผลงานก่อนหน้าของเขาหลายๆ เรื่อง &ldquo;อย่างที่คุณรู้ ผมเคยทำหนังเรื่องIndependence Day ที่ต่อยอดจากตำนานลึกลับของ 51&rdquo; เอมเมอริชกล่าว สำหรับเขา &ldquo;คุณไม่จำเป็นต้องเชื่อในทฤษฏีสมคบคิดต่างๆ แต่คุณปฏิเสธไม่ได้หรอกว่ามันน่าสนใจเอามากๆ&rdquo;<br />\r\n<br />\r\nเมื่อเจ็ดปีก่อน เอมเมอริชได้อ่านเกี่ยวกับทฤษฏี Hollow Moon ว่าด้วยแท้จริงแล้วดวงจันทร์ เป็นสิ่งปลูกสร้างขนาดยักษ์ ภายในกลวง โคจรในระบบสุริยะ แสงจากตัวมันส่องสว่างในยามค่ำคืน &ldquo;ผมจินตนาการออกทันทีว่าทฤษฏีนี้มันอาจต่อยอดไปเป็นสิ่งที่อาจจะทำลายเผ่าพันธ์มนุษย์เลยก็เป็นได้ จะเกิดไรขึ้นถ้าดวงจันทร์หลุดวงโคจรและตรงมาที่โลก ในขณะเดียวกันมันเปิดด้านที่เราไม่เคยรู้เกียวกับดวงจันทร์ด้วย&rdquo; เอมเมอริชกล่าว<br />\r\n<br />\r\nทฤษฏีนี้เป็นที่กล่าวถึงตั้งแต่ยุค 70 เมื่อโครงการอพอลโลโดยนาซ่าบันทึกการสั่นสะเทือนบทพื้นผิวดวงจันทร์ ที่กินระยะเวลานานกว่าบนโลก ไคลฟ์ อาร์. นีล ศาสตราจารย์ภาควิชาวิศวกรรมโยธาและเทคโนโลยีภาคธรณีแห่งมหาวิทยาลัย น็อทร์-ดาม ได้เขียนคำจำกัดความไว้บนเว็บไซต์ของนาซ่าว่า &ldquo;พระจันทร์มีเสียงสะท้อนเหมือนระฆัง&rdquo; เป็นเพราะพื้นผิวดวงจันทร์ปราศจากน้ำที่คอยรองรับแรงสั่นสะเทือนเหมือนที่โลกมี<br />\r\n<br />\r\nเอมเมอริชไม่ได้ต้องการทำ Moonfall เพื่อให้ผู้ชมอินกับทฤษฏีดังกล่าว เขาแค่อยากมอบความบันเทิงให้ทุกคน &ldquo;ผมไม่ได้อยากเอาทฤษฏีที่เข้าใจอยากมาเป็นสารตั้งต้นในการเขียนบท เราไม่ได้ยึดติดกับมันมาก แค่มีกลิ่นเล็กน้อยเท่านั้น&rdquo;<br />\r\n<br />\r\nโจ ฟาวเลอร์ (ฮัลลี เบอร์รี) เป็นหนึ่งในตัวละครที่ตระหนักได้ว่าโลกกำลังจะเจอกับหายนะ เธอเป็นอดีตนักบินอวกาศที่พยายามทำทุกวิถีทางเพื่อเตือนทุกคน แต่แน่นอนว่าไม่ใช่ใครเชื่อเธอจนกระทั่งมันสายเกินไป &ldquo;เธอเป็นรองผู้บัญชาการของนาซ่า เธอแบกอนาคตของมนุษยชาติไว้บนบ่า&rdquo; ผู้กำกับกล่าว<br />\r\n<br />\r\nแพทริก วิลสัน รับบทเป็น ไบรอัน ฮาร์เปอร์ มนุษย์อวกาสที่เชื่่อว่าฟาวเลอร์เป็นกุญแจสำคัญที่จะทำให้มนุษย์รอดจากการสูญพันธุ์ครั้งนี้ได้ เขาขออาสาทำภารกิจกู้โลกร่วมกับเธอ แต่มันไม่ได้ง่ายขนาดนั้นเพราเขาเคยมีประวัติทำภารกิจผิดพลาดมาก่อน &ldquo;มันเหมือนชีวิตของเขาโดนทำลาย เขาเป็นเพียงมนุษย์อวกาศคนเดียวที่สามารถนำยานลงจอดได้โดยไม่มีอุปกรณ์อีเล็กทรอนิคช่วยเหลือแล้วรอดมาได้ เขาเป็นคนที่ใช่สำหรับภารกิจนี้&rdquo; เอมเมอริชกล่าว<br />\r\n<br />\r\nสมาชิกคนที่สามของทีม คือผู้เชี่ยวชาญด้านพื้นผิวดวงจันทร์ รับบทโดย จอห์น แบรดลีย์ ที่สร้างชื่อจากGame of Thrones &ldquo;เขาดูเป็นพวกเนิร์ดที่มักโดนมองข้าม แต่เขาเป็นคนแรกที่ค้นพบว่าดวงจันทร์กำลังหลุดวงโคจร&rdquo; เอมเมอริชกล่าว</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/26122022142820-2565-12-26_14h28_11.jpg',	'ivIwdQBlS10',	'',	'2023-03-14',	0,	8,	0,	'',	'HD',	25,	2022,	'5.9',	'',	'',	'ดูหนังฟรี Moonfall (2022) วันวิบัติ จันทร์ถล่มโลก',	'ดูหนังฟรี Moonfall (2022) วันวิบัติ จันทร์ถล่มโลก',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, Moonfall (2022), วันวิบัติ จันทร์ถล่มโลก',	'https://streamhls.com/view/92971e66-138c-51f6-be44-f9240f95bea1.m3u8',	2999),
