(2020,	25,	1,	'TREMORS 5 BLOODLINE (2015) ทูตนรกล้านปี ภาค 5',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Tremors 5 Bloodline (2015) ทูตนรกล้านปี ภาค 5 <strong>เรื่องย่อ</strong></p>\r\n\r\n<p>Graboids มนุษย์กินคนยักษ์กลับมาแล้วและถึงตายกว่าเดิมทำให้ผู้คนในเขตอนุรักษ์สัตว์ป่าแอฟริกาใต้หวาดกลัวขณะที่พวกเขาจู่โจมจากด้านล่างและเหนือ</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/18012023191643-2566-01-18_19h16_30.jpg',	'pRfvUWkdzvQ',	'',	'2023-03-05',	0,	5,	0,	'',	'HD',	42,	2015,	'8.8',	'',	'',	'ดูหนังฝรั่งฟรี TREMORS 5 BLOODLINE (2015) ทูตนรกล้านปี ภาค 5',	'ดูหนังฝรั่งฟรี TREMORS 5 BLOODLINE (2015) ทูตนรกล้านปี ภาค 5',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, TREMORS 5 BLOODLINE (2015), ทูตนรกล้านปี ภาค 5',	'https://slave01.players2u.com/hls1/965bfec1e3a5e70eece8786c5458ecdf/965bfec1e3a5e70eece8786c5458ecdf.m3u8',	3091),
(2021,	25,	1,	'TREMORS 4 THE LEGEND BEGINS (2004) ทูตนรกล้านปี ภาค 4',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ&nbsp;TREMORS 4 THE LEGEND BEGINS (2004) ทูตนรกล้านปี ภาค 4</strong></p>\r\n\r\n<p>ภาคนี้ย้อนอดีตไปสมัยเก่าเลยครับ ในยุค 1800 งานนี้เป็นสมัยที่เมืองเพอร์เฟคชั่น ยังใช้ชื่อว่า &ldquo;รีเจคชั่น&rdquo; และที่นั่นก็กำลังมีการทำเหมืองกันอยู่ แต่แล้วธุรกิจเหมืองก็ล่มครับ เพราะดันมีตัวบ้าอะไรก็ไม่รู้โผล่มากินชาวเหมือง (เรารู้ครับว่ามันคือ &hellip; แกรบบอยด์) ทำให้ ไฮแรม กัมเมอร์ (Michael Gross อีกครั้ง) เจ้าของธุรกิจเหมืองต้องมาหาทางกวาดล้างพวกบ้านี่ให้จงได้</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/18012023191410-2566-01-18_19h13_43.jpg',	'VTd5edGke-4',	'',	'2023-03-05',	0,	5,	0,	'',	'HD',	42,	2004,	'8.3',	'',	'',	'ดูหนังฝรั่งฟรี TREMORS 4 THE LEGEND BEGINS (2004) ทูตนรกล้านปี ภาค 4',	'ดูหนังฝรั่งฟรี TREMORS 4 THE LEGEND BEGINS (2004) ทูตนรกล้านปี ภาค 4',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, TREMORS 4 THE LEGEND BEGINS (2004) ทูตนรกล้านปี ภาค 4',	'https://streamhls.com/view/ba88b665-91d4-5cf5-a4f2-90311aec860c.m3u8',	3090),
(2022,	25,	1,	'TREMORS 3 BACK TO PERFECTION (2001) ทูตนรกล้านปี ภาค 3',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ&nbsp;TREMORS 3 BACK TO PERFECTION (2001) ทูตนรกล้านปี ภาค 3</strong></p>\r\n\r\n<p><br />\r\nหนัง Tremors เรื่องที่สามพาเรากลับไปที่เมืองเล็ก ๆ แห่งความสมบูรณ์แบบเนวาดาที่ชาวเมืองและนักผจญภัย Burt Grummer กลับมาหลังจากเดินทางไปต่างประเทศและฆ่าหนอนกินเนื้อเรียกว่า &ldquo;Graboids&rdquo; (แนะนำในภาพยนตร์ภาคแรก) และลูกหลาน &ldquo;Shriekers&rdquo; ภาพยนตร์) ไปใช้ชีวิตในเมืองบ้านเกิดของเขาและต้องรับมือกับผู้พัฒนาที่ดินที่คดโกงคนที่กำลังมองหาแจ็คซอว์เยอร์กำลังมองหาความมั่งคั่งในเมืองท่องเที่ยวที่มีศักยภาพแห่งนี้และในที่สุดก็รับมือกับหนอน Graboid สายพันธุ์ใหม่ ระยะที่สองของ Shrieker และผู้ที่คาดไม่ถึงในขั้นตอนที่สามของพวกเขาสำหรับการต่อสู้ที่บาดใจกับเบิร์ตและแจ็คในทะเลทรายรอบเมือง</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/18012023191229-2566-01-18_19h12_10.jpg',	'A8vaV9xjnpA',	'',	'2023-03-05',	0,	5,	0,	'',	'HD',	42,	2001,	'7.9',	'',	'',	'ดูหนังฝรั่งฟรี TREMORS 3 BACK TO PERFECTION (2001) ทูตนรกล้านปี ภาค 3',	'ดูหนังฝรั่งฟรี TREMORS 3 BACK TO PERFECTION (2001) ทูตนรกล้านปี ภาค 3',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, TREMORS 3 BACK TO PERFECTION (2001) ทูตนรกล้านปี ภาค 3',	'https://streamhls.com/view/b76d6800-cb67-5b14-8849-c97df138e99f.m3u8',	3089),
(2023,	25,	1,	'TREMORS 2 AFTERSHOCKS (1996) ทูตนรกล้านปี ภาค 2',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ&nbsp;TREMORS 2 AFTERSHOCKS (1996) ทูตนรกล้านปี ภาค 2</strong></p>\r\n\r\n<p>เควิน เบคอน วาเลนไทน์ เพราะเขาย้ายเข้าเมืองไปตั้งนานแล้วปล่อยให้เพื่อนซี้ เอิร์ล บาสเซตต์ Fred Wardกับมือปืนจอมระห่ำจากภาคก่อนอย่าง เบิร์ต กัมเมอร์ Michael Gross มาเจอกับพวกหนอนบ้าและงานนี้มันไม่เหมือนเดิมเพราะมันกลายพันธุ์เป็นที่เรียบร้อย</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/18012023191040-2566-01-18_19h10_14.jpg',	'liJfZvXdiTE',	'',	'2023-03-05',	0,	6,	0,	'',	'HD',	42,	1996,	'7.0',	'',	'',	'ดูหนังฝรั่งฟรี TREMORS 2 AFTERSHOCKS (1996) ทูตนรกล้านปี ภาค 2',	'ดูหนังฝรั่งฟรี TREMORS 2 AFTERSHOCKS (1996) ทูตนรกล้านปี ภาค 2',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, TREMORS 2 AFTERSHOCKS (1996), ทูตนรกล้านปี ภาค 2',	'https://streamhls.com/view/f1a72871-4fde-52fe-8d5a-e658e8a387ac.m3u8',	3088),
(2024,	25,	1,	'TREMORS (1990) ทูตนรกล้านปี ภาค 1',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>เรื่องย่อ&nbsp;TREMORS (1990) ทูตนรกล้านปี ภาค 1</strong></p>\r\n\r\n<p>เปิดตำนานหนอนยักษ์กราบอยด์แห่งหนังชุด &nbsp;&ldquo;ทูตนรกล้านปี&rdquo; (The Tremors)</p>\r\n\r\n<p>ในช่วงยุค 90&rsquo;s &nbsp;เป็นช่วงยุคเฟื่องฟูของหนังสยองขวัญส่งตรงลงม้วนวีดีโอ บางเรื่องก็หายไปตามกาลเวลาหรือยังคงเป็นที่กล่าวถึงจนปัจจุบัน &nbsp;หนึ่งในนั้นจะต้องมีหนังชุด The Tremors หรือชื่อไทย ทูตนรกล้านปี ซึ่งเปิดตัวครั้งแรกในปี 1990 ก่อนจะมีการสร้างภาคต่อจนถึง 7 ภาค กับเรื่องราวของสัตว์ประหลาดหนอนยักษ์ที่อาศัยอยู่ใต้ดินออกฆ่าผู้คน เป็นว่าเล่นจนทำให้เหล่าผู้รอชีวิตไม่มีทางเลือกนอกจากจะสู้กับพวกมัน &nbsp;วันนี้เราจะพาไปรู้จักกับเจ้าสัตว์ประหลาดหนอนยักษ์จากใต้ดินผ่านเรื่องราวสยองปนความฮาจากหนังชุดนี้กัน เชิญรับชมกันได้เลยจ้า</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/18012023190842-2566-01-18_19h06_27.jpg',	'liJfZvXdiTE',	'',	'2023-03-05',	0,	6,	0,	'',	'HD',	42,	1990,	'7.1',	'',	'',	'ดูหนังฝรั่งฟรี TREMORS (1990) ทูตนรกล้านปี ภาค 1',	'ดูหนังฝรั่งฟรี TREMORS (1990) ทูตนรกล้านปี ภาค 1',	'เว็บเถื่อนดูหนังฟรี, ดูหนังฝรั่งฟรี, TREMORS (1990), ทูตนรกล้านปี ภาค 1',	'https://streamhls.com/view/cfe200c3-4bb0-5ad4-84ba-0df699e7f402.m3u8',	3087),
