(2030,	31,	1,	'จิตวิญญาณทหารแห่งราชวงศ์ฮัน Army Soul Of The Han Dynasty (2022)',	'',	'<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<h2>เรื่องย่อ : Army Soul of Han Dynasty จิตวิญญาณทหารแห่งราชวงศ์ฮัน (2022)</h2>\r\n\r\n<p>สำหรับเรื่องราวต่อจากนี้ของภาพยนตร์ &ldquo;Army Soul of Han Dynasty จิตวิญญาณทหารแห่งราชวงศ์ฮัน&rdquo; เล่าเรื่องมาที่แม่ทัพจอมปลอม อย่าง &ldquo;เกิงกง&rdquo; นักรบแห่งกองทัพฮั่นที่วางแผนจับกุมตัว &ldquo;ราชาเป่ยซงหนู&rdquo; ในเวลาเดียวกัน ต่อมาหลังจากที่แผนการสำเร็จนั้น แม่ทัพ &ldquo;เกิงกง&rdquo; ได้เลื่อนขั้นตำแหน่ง และยังได้ประจำการเป็นกองกำลังสำคัญ กองหน้าออกรบที่เมืองจินผู่ และในตอนนี้ &ldquo;ราชาเป่ยซงหนู&rdquo; ได้โกรธ &ldquo;เกิงกง&rdquo; เป็นอย่างมากและสั่งให้เหล่าทหารม้าชั้นยอดมากว่า 20,000 นาย บุกเข้าโจมตีแม่ทัพแห่งเมืองจินผู่ และในตอนนี้กองทัพของเมืองจินผู่ ที่มีกองกำลังนายทหารเพียงแค่ 300 คนเท่านั้นและในตอนนี้ การต่อสู้โดยมีแม่ทัพ &ldquo;เกิงกง&rdquo; นำต่อสู้และในช่วงเวลาแห่งความเป็นเเละความตาย เรื่องราวการล้างแค้นในตอนนี้เป็นเริ่มต้นของความหายนะทั้งหมด &ldquo;Army Soul of Han Dynasty จิตวิญญาณทหารแห่งราชวงศ์ฮัน&rdquo; เสียงและภาษาซับไทย &ndash; เต็มเรื่อง</p>\r\n</body>\r\n</html>\r\n',	'https://www.movie788.com/post-img-api/18012023142045-Army-Soul-Of-The-Han-Dynasty-2022.jpg',	'KSmEjCNgdek',	'',	'2023-03-05',	0,	8,	0,	'',	'SUB',	25,	2022,	'7.9',	'',	'',	'ดูหนังจีนฟรี จิตวิญญาณทหารแห่งราชวงศ์ฮัน Army Soul Of The Han Dynasty (2022)',	'ดูหนังจีนฟรี จิตวิญญาณทหารแห่งราชวงศ์ฮัน Army Soul Of The Han Dynasty (2022)',	'เว็บเถื่อนดูหนังฟรี, ดูหนังจีนฟรี, จิตวิญญาณทหารแห่งราชวงศ์ฮัน, Army Soul Of The Han Dynasty (2022)',	'https://master3.baraq.xyz/PlayList/63c7673c66862wGI/master.m3u8',	3081),
